let cakes =  
[
	{
		cakeName: "Victoria Sponge",
		ingredients: [
			"eggs",
			"butter",
			"sugar",
			"self-raising flour",
			"baking powder",
			"milk"
		],
		price: 5,
		rating: 5
	},

	// Tea Loaf
	{
		cakeName: "Tea Loaf",
		ingredients: [
			"eggs",
			"oil",
			"dried fruit",
			"sugar",
			"self-raising flour",
			"strong tea",
		],
		price: 2,
		rating: 3
	},

	// Carrot Cake
	{
		cakeName: "Carrot Cake",
		ingredients: [
			"carrots",
			"walnuts",
			"oil",
			"cream cheese",
			"flour",
			"sugar",
		],
		price: 8,
		rating: 5
	}
];

export default cakes;
